import ExpenseItem from "./components/Expenses/ExpenseItem";

const Expenses = data.map((data) => {
    return (
      <div>
        <ExpenseItem
          key={data.id}
          title={data.title}
          location={data.location}
          date={data.date}
          amount={data.amount}
        />
      </div>
    );
  })

  export default Expenses;
